import React from 'react';
import Navbar1 from '../Layout/Navbar1';
import { Link } from 'react-router-dom';

function Homepage() {
    return (
        <div>
          <Navbar1></Navbar1>
         <Link to="/"><h2>Homepage</h2></Link> 
        </div>
    );
}

export default Homepage;
